                            </svg>&nbsp;
                            0858 9346 7032
                        </h4>
                    </div>
                    <div className="col">
                        <a className="btn text-light btn-dark btn-block">Phone</a>
                    </div>
                </div>
            </div>
        );
    }
}

export default Contact;
